// import Vue from 'vue'
// import { createApp } from 'vue';
import VueRouter from 'vue-router'
import authUser from "./components/authUser.vue";
import App from './App.vue';

Vue.use(VueRouter)

const routes = [    
    { path: '/auth', component: authUser},
    { path: '/', component: App},
]

const router = new VueRouter({
    routes
});


export default router;

